import React from 'react';

// Компоненты
class User extends React.Component{
	render () {
		return(
            <div className='user' key={user.id}>
                    <h3>{user.firstname} {user.lastname}</h3>
                    <p>{user.bio}</p>
                    <b>{user.isHappy ? "Счастлив" : "Не счастлив"}</b>
            </div>
		)
	}
}

export default User;
